import React from "react";
import Header from "../general/Header.js";
import WebsiteFooter from "../general/WebsiteFooter.js";
import LoginBox from "./LoginBox.js";

function LoginPage() {
  
    return (
      <div>
        <Header />
        <LoginBox />
        <WebsiteFooter />
      </div>
    );
  }


export default LoginPage;
